import React from "react";

function RepoItem({ repo }) {
  return (
    <div className="card">
      <h3>
        <a href={repo.html_url} target="_blank" rel="noreferrer">
          {repo.name}
        </a>
      </h3>
    </div>
  );
}

export default RepoItem;
